const FOLLOW = "FOLLOW";
const UNFOLLOW = "UNFOLLOW";
const SET_USERS = "SET-USERS"

let initialState = {
    users: [
        {
            id: 1,
            fullName: "Mykola",
            status: "Some status",
            location: {city: "Brody", country: "Ukraine"},
            followed: true,
            photo: "data:image/jpeg;base64,"
        },
        {
            id: 2,
            fullName: "Vlad",
            status: "Some status 2",
            location: {city: "Ternopil", country: "Ukraine"},
            followed: true,
            photo: "data:image/jpeg;base64,"
        },
        {
            id: 3,
            fullName: "Edward",
            status: "Some status 3",
            location: {city: "Lviv", country: "Ukraine"},
            followed: false,
            photo: "data:image/jpeg;base64,"
        },
        {
            id: 4,
            fullName: "Andrii",
            status: "Some status 4",
            location: {city: "Kyiv", country: "Ukraine"},
            followed: false,
            photo: "data:image/jpeg;base64,"
        },
    ],

}

const usersReducer = (state = initialState, action) => {
    switch (action.type) {
        case FOLLOW:
            return follow(state, action);
        case UNFOLLOW:
            return unfollow(state, action);
        case SET_USERS :
            return {...state, users: [...state.users, ...action.users]};
        default:
            return state;
    }
}

function follow(state, action) {
    return {
        ...state,
        users: state.users.map(u => {
            if (u.id === action.userId) {
                return {...u, followed: true};
            }
            return u;
        })
    };
}

function unfollow(state, action) {
    return {
        ...state,
        users: state.users.map(u => {
            if (u.id === action.userId) {
                return {...u, followed: false};
            }
            return u;
        })
    };
}

export const followActionCreator = (userId) => {
    return {type: FOLLOW, userId: userId};
}

export const unfollowActionCreator = (userId) => {
    return {type: UNFOLLOW, userId: userId};
}

export const setUsersActionCreator = () => {
    return {type: SET_USERS};
}

export default usersReducer;